import React from "react";
import hotels from "../../../data/hotel_list.json";
import Hotelstype from "./hotelstype";

const Hotelstypes = () => {
  return (
    <div>
      <h3>Homes guests love</h3>
      <div className="hotels">
        {hotels.map((hotel) => (
          <Hotelstype>
            key={hotel.name} item={hotel}
          </Hotelstype>
        ))}
      </div>
    </div>
  );
};
export default Hotelstypes;
